import React from "react";

const ButtonMoreCurrency = onShowNewCurrency => {
  return (
    <button
      type="button"
      className="btn btn-primary btn-lg btn-block"
      onClick={onShowNewCurrency()}
    >
      Add More Currencies
    </button>
  );
};

export default ButtonMoreCurrency;
